$.clog=function(a,b){if(console&&typeof console.log!='undefined'&&DEV_ENV){switch(b){case'success':fg='#28a745';bg='#242424';break;case'info':fg='#17a2b8';bg='#242424';break;case'danger':fg='#dc3545';bg='#242424';break;case'start':fg='OliveDrab';bg='#242424';break;case'warning':fg='#ffc107';bg='#242424';break;case'end':fg='Orchid';bg='#242424';break;case'primary':fg='#007bff';bg='#242424';break;case'secondary':fg='#6c757d';bg='#242424';break;case'default':default:fg='#ffffff';bg='#242424';break}if(typeof a=='object'){console.log(a)}else if(typeof b=='object'){console.log('%c'+a,'color: PowderBlue;font-weight:bold; background-color: RoyalBlue;');console.log(b)}else{console.log('%c'+a,'color:'+fg+'; background-color: '+bg+';')}}};$.fn.clog=function(a){a=a||'';if(console&&typeof console.log!='undefined'&&DEV_ENV){console.log('%o ',this,a)}return this};
